import Slider from "./Slider";
import Card from "./Product";
import img from "../img/img1.jpg"
import img2 from "../img/img2.jpg"
import img3 from "../img/img3.jpg"
const Home=()=>{
    return(
        <>
        <div className="body">
        <Slider/>
        <div className="Container_products">
            <Card img= {img} title ="test" description="Lorem Ipsum is simply"/>
            <Card img= {img2} title ="test" description="Lorem Ipsum is simply"/>
            <Card img= {img3} title ="test" description="Lorem Ipsum is simply"/>
        </div>
        
        </div>
        </>
    )
}
export default Home;
